import React from "react";
import "./App.css";
import WorkoutCard from "./WorkoutCard"


function WorkoutList ( { selectedPlayer } ) {

    const { age, name, workouts} = selectedPlayer

    console.log(workouts, age, name)


    const workoutsToDisplay = workouts.map((workout) => <WorkoutCard key={workout.id} workout={workout} selectedPlayer={selectedPlayer}/>)

    return (
        <div>
            {workoutsToDisplay}
        </div>
    )
}

export default WorkoutList
